    private static char GetGameButtonLabel(Cell cell)
    {
        
        if (!cell.IsRevealed)
        {
            return '-';
        }
        switch (cell.MinesAround)
        {
            case 0:
                return ' ';
            case 1:
                return '1';
            case 2:
                return '2';
            case 3:
                return '3';
            case 4:
                return '4';
            case 5:
                return '5';
            case 6:
                return '6';
            case 7:
                return '7';
            case 8:
                return '8';
            default:
                throw new InvalidEnumArgumentException("Unknown cell option!");
        }
    }


